import React from 'react';
import NavBar from './NavBar';
import Messages from './Messages';

class Home extends React.Component {
    constructor(props) {
        super(props)
        this.state = {
            messages : [
                {
                    text: "Hello world",
                    member: {
                        color: "blue",
                        username: "ciesla"
                    }
                }
            ],
            member: {
                username: 'aciesla',
                color: 'pink'
            }
        };
    }
    render() {
        return (
            <div>
                <Messages
                    messages={this.state.messages}
                    currentMember={this.state.member}
                />
                <NavBar />
            </div>
        );
    }
}

export default Home;
